import React from 'react';
import axios from 'axios'
import './App.css';

function App() {
  state={
    users: []
  };
  componentDidMount = () => {
    axios.get('https://api.github.com/users/VanshikaP')
    .then(response => {
      console.log(response)
    })
    .catch(err => {
      console.log('Error in fetching user data', err.message)
    })
  }

  return (
    <div className="App">
      <h1>Hello</h1>
      <p>Are you still working?</p>
    </div>
  );
}

export default App;
